import React from 'react';

const Header = () => {
    return (
    <nav>
        <div className="row container">
            <div>
                <img src="/logo1.png" style={{width:"200px", height:"65px"}} alt="lobinton"/>
            </div>      


            <ul>
                <li><i className="material-icons">shopping_cart</i></li>
            </ul>
            </div>
    </nav>      
    )
}

export default Header;
